        function buildSeries(year){
            var month = data.filter(function(dataPoint){
                return new Date(dataPoint[0]).getFullYear() == year;
            });

            month = month.sort(function(a,b){
                if(a[0] < b[0]){
                    return -1;
                }
                else if(a[0] > b[0]){
                    return 1;
                }

                return 0;
            });

            var seriesData = []
            month.forEach(function(item){
                var date = new Date(item[0])
                seriesData.push([Date.UTC(2014, 0, date.getDate(), date.getHours(), 0), Number(item[1])]);
            });



            return seriesData;
        }

        function build_highcharts_config(){

         return {
            title: {
                text: 'Wikipedia Usage'
            },

            yAxis: {
                title: {
                    text: 'Visitors'
                },
                plotLines: [{
                    value: 0,
                    width: 1,
                    color: '#808080'
                }],
                min: 0
            },
            xAxis: {
                title: {
                    text: 'Time'
                },
                type: 'datetime',
                tickPixelInterval: 100,
            },

            series: [
            {
                name: "January " + 2013,
                data: buildSeries(2013)
            },
            {
                name: "January " + 2014,
                data: buildSeries(2014)
            }
            ]
        }
    }

        function findMean(dataset){
            var sum = 0;
            var count = 0;
            dataset.forEach(function(dataPoint){
                count++;
                sum += dataPoint[1];
            });

            var mean = sum / count;
            return mean;
        }

        function formatMillions(num){
            return (num / 1000000).toFixed(0) + "M"

        }

        function findSD(dataset, mean){
            var sumOfSquaredDifference = 0;
            dataset.forEach(function(dataPoint){
                sumOfSquaredDifference += Math.pow(dataPoint[1] - mean, 2);
            });

            console.log(sumOfSquaredDifference)
            return Math.sqrt(sumOfSquaredDifference / dataset.length);
        }

        var chart = build_highcharts_config(2013);
        var mean2013 = findMean(chart.series[0].data);
        var sd2013 = findSD(chart.series[0].data, mean2013);


        var mean2014 = findMean(chart.series[1].data);
        var sd2014 = findSD(chart.series[1].data, mean2014);

        $('#training').after('2014 Mean: ' + formatMillions(mean2014)+ ", Standard Deviation: " + formatMillions(sd2014) + "<br />");
        $('#training').after('2013 Mean: ' + formatMillions(mean2013) + ", Standard Deviation: " + formatMillions(sd2013) + "<br /> ");

        $('#training').highcharts(chart);



    });
